#include <stdio.h>

int main() {
    int nvalues;
    int op, suma =0;
    scanf("%i", &nvalues);
    for (int i = 0; i < nvalues; i++) {
        scanf("%i", &op);
        suma += op;
    }
    printf("%i\n", suma);
    return 0;
}

