import java.util.Scanner;

public class suma {

    public static void main(String[] args) {

        // input
        Scanner scan = new Scanner(System.in);
        int n = scan.nextInt();

        // sum
        int val, i, sum = 0;
        for (i=0; i<n; i++) {
            val = scan.nextInt();
            sum += val;
        }

        System.out.println(sum);
    }
}

